import{_ as e,o as l,c as t,a3 as a}from"./chunks/framework.-fNtKYRb.js";const m=JSON.parse('{"title":"关于我","description":"描述关于我的信息。","frontmatter":{"date":"2022-7-1","sidebar":false,"description":"描述关于我的信息。","tag":["关于"],"sticky":9},"headers":[],"relativePath":"notes/about/index.md","filePath":"notes/about/index.md","lastUpdated":1726816794000}'),s={name:"notes/about/index.md"};function o(n,i,d,p,r,c){return l(),t("div",{"data-pagefind-body":!0},i[0]||(i[0]=[a('<h1 id="关于我" tabindex="-1">关于我 <a class="header-anchor" href="#关于我" aria-label="Permalink to &quot;关于我&quot;">​</a></h1><p>一位犹如咸鱼的普通人！</p><p>欢迎您，来到我的个人博客，你，我生命中一个重要的过客，我们之所以是过客，因为你未曾会为我停留。</p><p>在不断的技术学习和实践中，我始终保持着对新技术的热情和好奇心。</p><p>作为一名工程师，学不可以已，不断挑战自己，拓宽技术领域。</p><p>这是记笔记的地方，平时比较忙，尽量抽出时间来记笔记，虽说很少记笔记，但是写随笔是一个好习惯。某一天我还没有更新笔记，那就代表我正在忙工作，或者是正在DIY。</p><p>感谢大家阅读我的博客，希望我的分享能给大家带来帮助和启发。</p><h2 id="部署博客" tabindex="-1">部署博客 <a class="header-anchor" href="#部署博客" aria-label="Permalink to &quot;部署博客&quot;">​</a></h2><p>原博客采用Hexo结合Pug模板语言，虽然功能强大，但代码阅读与维护门槛较高，不利于快速迭代与个性化定制。随着技术栈的不断演进，寻找一个更加现代化、易于理解、易于迁移及修改的框架成为迫切需求。</p><p>Vitepress以其基于Vue.js与TypeScript的架构脱颖而出，不仅符合当前前端开发的主流趋势，还极大地降低了开发门槛，使得非专业前端开发者也能轻松上手。Vue的响应式特性与组件化思想，结合TypeScript的强类型检查，不仅提升了开发效率，也增强了代码的可维护性与可扩展性。此外，Vitepress的文档站点生成能力，完美契合博客内容管理与展示的需求，为博客的未来发展奠定了坚实的基础。因此，选择Vitepress重新部署博客，是追求技术革新、提升体验与降低维护成本的重要一步。</p><h2 id="时间轴" tabindex="-1">时间轴 <a class="header-anchor" href="#时间轴" aria-label="Permalink to &quot;时间轴&quot;">​</a></h2><div class="timeline-dot"><span class="timeline-dot-title">2024</span><ul><li>重新部署博客。</li></ul></div><div class="timeline-dot"><span class="timeline-dot-title">2023</span><ul><li>2023年， 电子发烧友，被称为优秀工程师。</li><li>二三月投了谷歌，六月初得到offer</li><li>7月在谷歌软件工程，如下工作： <ul><li>参与公司软件项目的开发与维护，确保项目按时交付;</li><li>与团队合作，解决日常开发中的技术难题，推动项目进展;</li><li>主动识别并解决用户痛点，提出并实施了多项功能，显著提升了产品功能和用户满意度。</li></ul></li></ul></div><div class="timeline-dot"><span class="timeline-dot-title">2022年</span><ul><li>2019-2022年大家在疫情下生活。</li><li>2022年，每个月做了几次文章，关于嵌入式软件开发，在板子上开发某个功能，并发布到电子发烧友。</li><li>6月 在苏州伟创力，物料协调、调账、报废、报表、库存分析,可借助代码处理琐屑事情，提炼数据，如下工作： <ul><li>有协调沟通能力,基本掌握和使用办公软件;</li><li>依据国家税务法规做好交税工作;</li><li>物料管理数据的处理和维护;</li><li>定期对财务报表分析,为公司经营管理决策提供详实依据;</li><li>检查月末盘点工作。</li></ul></li><li>7月 在北京联合大学顺利毕业，拿到本科。</li><li>同月 转正了。</li></ul></div>',14)]))}const h=e(s,[["render",o]]);export{m as __pageData,h as default};
